window.bookSummaryJSON = "<p><b>I thought I could run from daddy. I was wrong.</b></p> <p>Dean Waterhouse was supposed to be a job. Get in. Get married. Take his money and get out.</p> <p>But he came after me.</p> <p>Now, I'm bound to his bed, about to learn what happens to naughty girls who play games.</p> <p>The man who put his ring on my finger was gentle. The man who tracked me down is not.</p> <p>He's going to make me blush, beg, and scream for him.</p> <p>Then, he's going to make me call him <i>daddy</i>.</p> <p><b>Publisher's note:</b> <i>Reckoning</i> includes spankings and rough, intense sexual scenes. If such material offends you, please don't buy this book.</p>"; 
